function Home() {
    useEffect(() => {
        let vh = window.innerHeight * 0.01;
        document.documentElement.style.setProperty("--vh", `${vh}px`);
    }, []);

    return (
        <>
            <GlobalStyles />
            <IntroOverlay />
            <Banner />
            <Cases />
        </>
    );
}

export default Home;
